#include <vector>
using namespace std;

class Solution {
public:
    int findChampion(vector<vector<int>>& grid) {
        int champion = 0;
        int n = grid.size();

        for (int i = 1; i < n; ++i) {
            if (grid[champion][i] == 0) {
                // If the current champion loses to team i, then team i becomes the new potential champion
                champion = i;
            }
        }

        // Verify if the chosen champion is indeed stronger than all other teams
        for (int i = 0; i < n; ++i) {
            if (i != champion && (grid[champion][i] == 0 || grid[i][champion] == 1)) {
                return -1;  // No champion found
            }
        }

        return champion;
    }
};
